import React from 'react';

const landingPage = () => {
  return(
  <div id="hero" class="jumbotron">
    <div class="container">
      <h1 class="hero-title" class="load-hidden">
      <span class="text-color-main">Some corny flashcard app name</span> is a great way to learn software development if you enjoy studying the old fashion way!
      </h1>
      <p class="hero-cta" class="load-hidden">
        <a class="cta-btn cta-btn--hero" href="#">Start learning now!</a>
      </p>
    </div>
  </div>
  )
}

export default landingPage;
